London & Partners Limited, trading as London & Partners, is the official promotional company for London. We promote London and attract businesses, events, conferences, students and visitors to the capital. Our aims are to build London’s international reputation and to attract investment and visitor spend, which create jobs and growth.
London & Partners is a not-for-profit public private partnership, funded by the Mayor of London and our network of commercial partners.
This policy sets out the basis on which any personal data we collect from you, that you provide to us,  or that we may collect from other sources will be processed by us.  This includes the various ways in which you interact with us, whether through one of our many websites, for example studylondon.com (“sites”) and our mobile applications, for example, the Visit London mobile application (“apps”).  Together our sites and applications are known as our “platforms”).  We may also interact with you through the various services we provide, from organising business conferences to administering the domain registration for “dot London” (“services”).  
Please read the following carefully to understand our views and practices regarding your personal data and how we will treat it.
You can find a full list of our platforms in Appendix A
Links to third party sites may appear on our platforms. Those third party sites are not our responsibility, although use our best efforts to choose them with care. You should read and satisfy yourself with those third parties' privacy policies before using such linked sites.

What information do we collect from you?

Information you give us. This is information about you that you may give us by:

filling in forms on any of our platforms;
as part of using our services;
by corresponding with us by phone, e-mail, online chat or otherwise;
downloading an app and/or registering on one of our platforms;
Interacting with our platforms (for example, subscribing to any services, making an in-app purchase or entering a competition);
Sharing information on social media from our platforms; or
Reporting a problem or concern with one of our platforms. 


Information we collect about you. With regard to each of your visits to our sites and/or the apps we may automatically collect the following information:

technical information, including the internet protocol (IP) address used to connect your computer to the internet, type of mobile device you use, a unique device identifier (for example your device’s IMEI number, the MAC address of the device’s wireless network interface or the mobile phone number used by the device), mobile network information, your mobile operating system, your login information, browser type and version you use, time zone setting, browser plug-in types and versions, operating system and platform;
information about your visit to our platforms, including the full uniform resource locators (URL) clickstream to, through and from our platforms (including date and time); pages you viewed or information you searched for; page response times, download errors, length of visits to certain pages, page interaction information (such as scrolling, clicks, and mouse-overs), and methods used to browse away from the page and any phone number used to call our customer service number;
information stored on your mobile device, which may include contact information, friends lists, login information, photos, videos or other digital content, check ins;
details of your use and visits to any of our platforms including, but not limited to traffic data, weblogs and other communication data, whether this is required for our own billing purposes or otherwise and the resources that you access;
we also use GPS technology in some apps to determine your location.Some of our location-enabled services within apps require your personal data for the feature to work. If you wish to use the particular feature, you will be asked to consent to your data being used for this purpose. You can withdraw your consent at any time by adjusting the settings of the application on your mobile device;
when you install or uninstall a service containing a unique application number or when such a service searches for automatic updates, that number and information about your installation, for example, the type of operating system, may be sent to us.


Information we receive from other sources. We may receive information about you if you use any other websites we operate or other services we provide. We also work with third parties (including, for example, electronic analytics, business partners, sub-contractors in technical, payment and delivery services, advertising networks, analytics providers, search information providers, credit reference agencies) and may receive information about you from them.
The types of personal information we process. The personal information we collect can include:

your full name;
postal address;
employer and job title;
e-mail address;
records of your correspondence with us;
phone number (s);
username and password;
photos and videos;
social media account names;
payment details;
and any other information you may share with us or enter into any of our platforms.


On occasion we also collect sensitive personal data about you, for example, health information. We only collect this data where we have your explicit consent, unless we are permitted to do so in other circumstances under data protection law. For example, we may make a record that a person has particular access requirements to ensure he or she may attend an event.
We may combine information you give to us and information we collect about you. We may use this information and the combined information for the purposes set out above (depending on the types of information we receive).
Personal data may be legally collected and used if it is necessary for a legitimate interest of the organisation using the data, as long as its use is fair and does not adversely impact the rights of the individual concerned. When we use your personal information, we will always consider if it is fair and balanced to do so and if it is within your reasonable expectations. We will balance your rights and our legitimate interests to ensure that we use your personal information in ways that are not unduly intrusive or unfair. Our legitimate interests include:

Promotion of our purposes, including to develop new offers and services (both independently and with our partners) to promote London to visitors, students and businesses;
Administration and operational management, including responding to solicited enquires, providing information that you have requested, research, events management, the administration of our resources and tools.
Liaising with third parties, including working with partner organisations to develop new programmes and resources which further our purposes.


If you would like more information on our uses of legitimate interests or to change our use of your personal data in this manner, please get in touch with us using the details in the “Contact us” section below.
We may disclose your personal information to third parties:

in the event that we transfer, sell or buy any business or assets, in which case we may disclose your personal data to the prospective seller or buyer of such business or assets; and/or
if we are under a duty to disclose or share your personal data in order to comply with any legal obligation, or in order to enforce or apply our terms of use and other agreements; or to protect the rights, property, or our safety and/or, our customers, or others. This includes exchanging information with other companies and organisations for the purposes of fraud protection and credit risk reduction.


We may allow our staff, consultants and/or external providers (data processors) acting on our behalf to access and use your information for the purposes for which you have provided to us (e.g. to analyse data and to process payments). We only provide them with the information they need to deliver the relevant service, and ensure that we take steps to ensure that they process personal data in a secure manner.


How do we use your personal information?

We use information held about you in the following ways:

communicate with you in response to a specific action performed by you on our platforms, e.g. when you book a hotel, buy a ticket, reserve a table, leave a review, enter a competition, etc;
to provide you with support in using our platforms, and to provide you with the information, products and services that you request from us;
to provide you with information about one of our many events, for example our conferences on trade and business in London;
to provide you with information about other services we offer that are similar to those that you have already enquired about, for example newsletters, competitions and offers;
to provide you, or permit selected third parties to provide you, with information about goods or services we feel may interest you. If you are an existing subscriber, we will only contact you by electronic means (e-mail or SMS) with information about services similar to those which we offer on our platforms. If we permit selected third parties to use your data, we (or they) will contact you by electronic means only if you have consented to this. If you are a business contact, we may contact you with information about London and the opportunities we (and our business partners) can offer you.If you do not want us to use your data in this way, or to pass your details on to third parties for marketing purposes, please tick the relevant box situated on the form on which we collect your data;
if you are interested in developing your business in London, we may contact you to provide you with information which we feel may be of interest to you, and/or business contacts which may help you;
to send you news items which are relevant to your interests;
to notify you about changes to our services;
to ensure that content from our platforms is presented in the most effective manner for you and for your computer and/or your mobile device;
to administer our platforms for internal operations, including troubleshooting, data analysis, testing, research, statistical and survey purposes;
to improve our platforms to ensure that content is presented in the most effective manner for you and for your computer and/or your mobile device;
to help us improve and personalise our services, both on our own platforms and on third party sites;
to allow you to participate in interactive features of our services, when you choose to do so;
as part of our efforts to keep our platforms safe and secure;
to measure or understand the effectiveness of advertising we serve to you and others, and to deliver relevant advertising to you;
to make suggestions and recommendations to you and other users of our platforms about goods or services that may interest you or them.




Our Legal Basis for processing data

Organisations that collect and use personal data must have a lawful basis for doing so under data protection law and we are required to let you know the lawful basis on which we rely to process your personal data.We rely upon the following lawful bases:

Your consent to use your data for a particular purpose (for example to send you direct marketing by e-mail or to collect sensitive personal data);
Where the use of the data is in our “legitimate interests” (see below for more information);
Where we need to process your data in order to perform our obligations under a contract that we have entered into with you (for example to enrol you in an event or provide you with access to resources); and
To process data where we are under a legal obligation to do so.




Will we share your information with others?

We may share your personal information with any member of our group, which includes our group companies both in the UK and outside the UK.
We may share your information with selected third parties including:

business partners, suppliers and sub-contractors for the performance of any contract we enter into with them or you;
we may (with your consent, where appropriate) pass your details onto third parties including our partners to provide you with information and offers which may be of interest to you;
advertisers and advertising networks that require the data to select and serve relevant adverts to you and others. We do not disclose information about identifiable individuals to our advertisers, but we may provide them with aggregate information about our users (for example, we may inform them that 500 men aged under 30 have clicked on their advertisement on any given day). We may also use such aggregate information to help advertisers reach the kind of audience they want to target (for example, women in south London). We may make use of the personal data we have collected from you to enable us to comply with our advertisers' wishes by displaying their advertisement to that target audience; and
analytics and search engine providers that assist us in the improvement and optimisation of our platforms.




How do we protect the security of personal data?

We have put in place appropriate security measures to prevent your personal information from being accidentally lost, used or accessed in an unauthorised way, altered or disclosed.
While we will use all reasonable efforts to safeguard your personal data, you acknowledge that the use of the internet is not entirely secure and for this reason we cannot guarantee the security or integrity of any personal data that are transferred via the internet. If you have any particular concerns about your information, please contact us.


We have put in place procedures to deal with any suspected data security breach and will notify you and any applicable regulator of a suspected breach where we are legally required to do so.

The information we collect from you may be transferred to and processed and/or stored at a destination outside the European Economic Area (“EEA”). If we send your personal data outside the EEA we will take reasonable steps to ensure that the recipient implements appropriate measures to protect your information.


How long do we keep your data for?

We will only retain your personal information for as long as necessary to fulfil the purposes we collected it for, including for the purposes of satisfying any legal, accounting, or reporting requirements. To determine the appropriate retention period for personal data, we consider the amount, nature, and sensitivity of the personal data, the potential risk of harm from unauthorised use or disclosure of your personal data, the purposes for which we process your personal data and whether we can achieve those purposes through other means, and the applicable legal requirements.
In some circumstances we may anonymise your personal information so that it can no longer be associated with you, in which case we may use such information without further notice to you. Once you no longer have a relationship with us, we will retain and securely destroy your personal information in accordance with applicable laws and regulations.
If you request to receive no further contact from us, we will keep some basic information about you on our suppression list in order to avoid sending you unwanted materials in the future.


Your privacy rights

You have a number of rights under data protection legislation. These include:

Right of access
You have the right to know what information we hold about you and to ask, in writing, to see your records. We will provide you with details of the records we hold as soon as possible and at latest within one month, unless the request is complex. We may require proof of identity before we are able to release the data. Please use the details in the “Contact us” section below if you would like to exercise this right.

Right to be informed
You have the right to be informed how your personal data will be used. This policy as well as any additional information or notice that is provided to you either at the time you provided your details, or otherwise, is intended to provide you with this information.

Right to withdraw consent
Where we process your data on the basis of your consent (for example, to send you marketing texts or e-mails) you can withdraw that consent at any time. To do this, or to discuss this right further with us, please contact us using the details in the “Contact us” section below.

Right to object
You also have a right to object to us processing data where we are relying on it being within our legitimate interests to do so (for example, to send you direct marketing by post). To do this, or to discuss this right further with us, please contact us using the details in the “Contact us” section below.

Right to restrict processing
In certain situations you have the right to ask for processing of your personal data to be restricted because there is some disagreement about its accuracy or legitimate usage.

Right of erasure
In some cases, you have the right to be forgotten (i.e. to have your personal data deleted from our database). Where you have requested that we do not send you marketing materials we will need to keep some limited information in order to ensure that you are not contacted in the future.

Right of rectification
If you believe our records are inaccurate you have the right to ask for those records concerning you to be updated. To update your records please get in touch with us using the details in the “Contact us” section below.

Right to data portability
Where we are processing your personal data because you have given us your consent to do so, you have the right to request that the data is transferred from one service provider to another.
Complaints
            If you are unhappy with the way in which we have handled your personal information please contact us using the details below. You are also entitled to make a complaint to the Information Commissioner’s Office - https://ico.org.uk/.





How will we let you know of changes to our privacy policy?
We may update this policy from time to time without notice to you, so please check it regularly. We will however aim to bring any significant changes to your attention. The privacy policy was last updated in 17 May 2018.

How to contact us?

Questions, comments and requests regarding this privacy policy are welcomed and should be addressed to dataprotection@londonandpartners.com.
Contact Office: 6th Floor, 2 More London Riverside, London SE1 2RR Tel. +44 (0)20 7234 5800



COOKIES POLICY
Our platforms use cookies to distinguish you from other users of our platforms. A cookie is a small file of letters and numbers that we store on your browser or your hardware (your computer or mobile device). Cookies contain information that is transferred to your computer or mobile device. 
Cookies help us to provide you with a good experience when you use our platforms and also allow us to improve our platforms. By continuing to use and browse our platforms, you are agreeing to our use of cookies.
We use the following cookies:

Strictly necessary cookies. These are cookies that are required for the operation of our platforms. They include, for example, cookies that enable you to log into secure areas of our platforms.
Analytical/performance cookies. They allow us to recognise and count the number of visitors and to see how visitors move around our platforms when they are using them. This helps us to improve the way our sites and/or the App works, for example, by ensuring that users are finding what they are looking for easily.
Functionality cookies. These are used to recognise you when you return to our platforms. This enables us to personalise our content for you and remember your preferences (for example, your choice of language or region).
Targeting cookies. These cookies record your visits to our platforms, the pages you have visited and the links you have followed. We will use this information to make our platforms and any advertising displayed on them more relevant to your interests. We may also share this information with third parties for this purpose.
Remarketing cookies. You may notice that sometimes after visiting a site you see increased numbers of adverts from the site you visited. This is because advertisers, including ourselves pay for these adverts. The technology to do this is made possible by cookies and as such we may place a so called "remarketing cookie" during your visit. We use these adverts to offer special offers etc to encourage you to come back to our site. We cannot proactively reach out to you as the process is entirely anonymised.

You can find more information about the individual cookies we use and the purposes for which we use them in the table below:



Cookie
Purpose


Essential Site Functionality
Examples of purposes for which a cookie may be used: when a user registers with the site, London & Partners generate cookies that let us know whether the user is signed in or not. Often, but not always, connected to an email address.


Personalisation and Marketing
This cookie is essential for our site as it enables us to: Serve content based on the user's past browsing behaviour on the site. Recording that a user has seen a particular registration prompt popup so as not to show it again. It does this by serving A/B tests and ensuring that a given user always sees the same variant. It records whether a user who has clicked an off-site advert for our site has completed a goal (register, purchase, etc.). Only connected to an email address if the user has also registered. May be first or third part cookies or a mix of the two.


Anonymous Analytics
Collecting aggregate data on the most viewed pages, number of unique site visits, length of time spent on site. Not connected to an email address.



Google Analytics
Google Analytics are used widely by websites and mobile applications to collect information about how visitors use a site and/or the App. We may use Google Analytics cookies to collect information about how users use our platforms and to improve our platforms.
Google Analytics collect information in an anonymous form and will not allow us to identify you or collect any personal information about you.
Google Analytics do not track your internet activity after leaving our platforms.
Social media cookies
Our platforms may contain buttons and content from social media sites such as Facebook, Twitter and YouTube to enable you to share content from our platforms with your social media networks. If you use these features, these social media sites may use their own cookies. Information on how these are used can be found on their respective websites.
Third parties’ cookies
Please note that third parties (including, for example, advertising networks and providers of external services like web traffic analysis services) may also use cookies, over which we have no control. These cookies are likely to be analytical/performance cookies or targeting cookies.
You may block cookies by activating the setting on your browser that allows you to refuse the setting of all or some cookies. However, if you use your browser settings to block all cookies you may not be able to access all or parts of our platforms.
It may be that your concerns around cookies relate to so called "spyware". Rather than switching off cookies in your browser you may find that anti-spyware software achieves the same objective by automatically deleting cookies considered to be invasive. Learn more about managing cookies with antispyware software.
